import React, { Component } from 'react';
import './App.css';
import GroupList from './components/ListGroup'

class App extends Component {







  render() {
    const {groups, isLoading} = this.state;

    if (isLoading) {
      return <p>Loading...</p>;
    }

    return (
      <div className="App">
        <GroupList/>
      </div>
    );
  }
}

export default App;
